31\u0633\u06CC\u062F. \u062F\u0631 \u0622\u0646 \u0635\u0648\u0631\u062A \u0628\u0647 \u0647\u0631 \u062F\u0648 \u0634\u0645\u0627 \u06CC\u06A9 \u0639\u062F\u062F \u0627\u0632 \u0647\u0631 \u062C\u0646\u0633 \u062A\u0639\u0644\u0642 \u062E\u0648\u0627\u0647\u062F \u06AF\u0631\u0641\u062A<\/p><p>.\u062A\u0644\u0627\u0634 \u06A9\u0646\u06CC\u062F \u0628\u06CC\u0634\u062A\u0631\u06CC\u0646 \u0627\u0634\u06CC\u0627\u0626\u06CC \u0631\u0627 \u06A9\u0647 \u0646\u06CC\u0627\u0632 \u062F\u0627\u0631\u06CC\u062F \u0628\u0647 \u062F\u0633\u062A \u0622\u0648\u0631\u06CC\u062F<\/p><p>:\u062F\u0631 \u0627\u06CC\u0646\u062C\u0627 \u0646\u0645\u0627\u062F \u0645\u062A\u0646\u0627\u0638\u0631 \u0628\u0627 \u0647\u0631 \u0634\u06A9\u0644 \u0646\u0634\u0627\u0646 \u062F\u0627\u062F\u0647 \u0634\u062F\u0647 \u0627\u0633\u062A <\/p><p>\u062F\u0627\u0631\u0648 <img src="http://emotions.usc.edu/group/images/Pills-MD.png" alt="\u062F\u0627\u0631\u0648" width="42" height="42" /><\/p><p>\u0628\u0637\u0631\u06CC\u0647\u0627\u06CC \u0622\u0628 <img src="http://emotions.usc.edu/group/images/Waterbottle-MD.png" alt="\u0628\u0637\u0631\u06CC\u0647\u0627\u06CC \u0622\u0628" width="42" height="42" /><\/p><p>\u067E\u0648\u0644 <img src="http://emotions.usc.edu/group/images/CashPic-MD.png" alt="\u067E\u0648\u0644" width="42" height="42" /><\/p><p>\u06A9\u0646\u0633\u0631\u0648 \u063A\u0630\u0627 <img src="http://emotions.usc.edu/group/images/can-new.png" alt="\u06A9\u0646\u0633\u0631\u0648 \u063A\u0630\u0627" width="42" height="42" /><\/p><\/div>',sNd='<div align="right"><p>\u0632\u0645\u06CC\u0646 \u0644\u0631\u0632\u0647 \u0627\u06CC \u062F\u0631 \u0634\u0647\u0631 \u0634\u0645\u0627 \u0631\u062E \u062F\u0627\u062F\u0647 \u0627\u0633\u062A \u0648 \u062A\u0639\u062F\u0627\u062F \u0632\u06CC\u0627\u062F\u06CC \u0632\u062E\u0645\u06CC \u0648 \u0645\u062C\u0631\u0648\u062D \u0634\u062F\u0647 \u0627\u0646\u062F. \u0647\u0645\u0647 \u06CC \u0645\u0633\u06CC\u0631\u0647\u0627\u06CC \u0627\u0631\u062A\u0628\u0627\u0637\u06CC \u0628\u0633\u062A\u0647 \u0634\u062F\u0647 \u0648 \u0628\u0646\u0627\u0628\u0631\u0627\u06CC\u0646 \u06A9\u0645\u06A9\u0647\u0627 \u0627\u0639\u0645 \u0627\u0632 \u067E\u0632\u0634\u06A9\u06CC \u06CC\u0627 \u063A\u0630\u0627\u06CC\u06CC \u0628\u0647 \u06A9\u0646\u062F\u06CC \u0628\u0647 \u0634\u0647\u0631 \u0645\u06CC \u0631\u0633\u062F \u0648 \u0628\u0647 \u0647\u0645\u06CC\u0646 \u062F\u0644\u06CC\u0644 \u0647\u0631 \u06A9\u062F\u0627\u0645 \u0627\u0632 \u062C\u0639\u0628\u0647 \u0647\u0627\u06CC \u06A9\u0645\u06A9\u06CC \u06A9\u0647 \u062A\u0648\u0633\u0637 \u0647\u0644\u06CC\u06A9\u0648\u067E\u062A\u0631 \u0628\u0647 \u0622\u0646\u062C\u0627 \u0645\u06CC \u0631\u0633\u062F \u0628\u0627\u06CC\u062F \u062F\u0631 \u0627\u062E\u062A\u06CC\u0627\u0631 \u062F\u0648 \u062E\u0627\u0646\u0648\u0627\u0631 \u0642\u0631\u0627\u0631 \u06AF\u06CC\u0631\u062F. <\/p><p>\u062A\u0635\u0648\u0631 \u06A9\u0646\u06CC\u062F \u06A9\u0647 \u0634\u0645\u0627 \u0648 \u062E\u0627\u0646\u0648\u0627\u062F\u0647 \u0627\u06CC \u06A9\u0647 \u0645\u062C\u0628\u0648\u0631 \u0628\u0647 \u062A\u0642\u0633\u06CC\u0645 \u0628\u0633\u062A\u0647 \u06CC \u06A9\u0645\u06A9\u06CC \u062E\u0648\u062F \u0628\u0627 \u0622\u0646\u0647\u0627 \u0647\u0633\u062A\u06CC\u062F\u060C \u0647\u0631 \u062F\u0648 \u06A9\u0648\u062F\u06A9\u06CC \u0628\u06CC\u0645\u0627\u0631 \u062F\u0627\u0631\u06CC\u062F \u06A9\u0647 \u0628\u0647 \u062F\u0627\u0631\u0648\u06CC \u067E\u0646\u06CC \u0633\u06CC\u0644\u06CC\u0646 \u0646\u06CC\u0627\u0632 \u062F\u0627\u0631\u062F \u062A\u0627 \u062C\u0644\u0648\u06CC \u0639\u0641\u0648\u0646\u062A \u0646\u0627\u0634\u06CC \u0627\u0632 \u062C\u0631\u0627\u062D\u062A \u0631\u0627 \u0628\u06AF\u06CC\u0631\u062F \u0632\u06CC\u0631\u0627 \u0645\u06CC \u062A\u0648\u0627\u0646\u062F \u0628\u0647 \u0645\u0631\u06AF \u0627\u0648 \u0628\u06CC\u0627\u0646\u062C\u0627\u0645\u062F. \u0639\u0644\u0627\u0648\u0647 \u0628\u0631 \u0627\u06CC\u0646\u060C \u0630\u062E\u06CC\u0631\u0647 \u06CC \u063A\u0630\u0627\u06CC\u06CC \u0634\u0645\u0627 \u0646\u06CC\u0632 \u06A9\u0645 \u0627\u0633\u062A \u0627\u0645\u0627 \u0645\u06CC\u0632\u0627\u0646 \u0622\u0628 \u0622\u0634\u0627\u0645\u06CC\u062F\u0646\u06CC \u062F\u0631 \u062F\u0633\u062A\u0631\u0633\u062A\u0627\u0646 \u0628\u0631\u0627\u06CC \u0686\u0646\u062F\u06CC\u0646 \u0631\u0648\u0632 \u06A9\u0627\u0641\u06CC \u0627\u0633\u062A. \u0647\u0645\u0647 \u06CC \u0641\u0631\u0648\u0634\u06AF\u0627\u0647  \u062F\u0631 \u0634\u0647\u0631 \u062A\u0639\u0637\u06CC\u0644 \u0634\u062F\u0647 \u0627\u0646\u062F \u0648 \u0645\u0634\u062E\u0635 \u0646\u06CC\u0633\u062A \u06A9\u0647 \u0628\u062A\u0648\u0627\u0646\u06CC\u062F \u0627\u0632 \u0622\u0646\u062C\u0627 \u0686\u06CC\u0632\u06CC \u0628\u062E\u0631\u06CC\u062F.<\/p><p>  \u0628\u0627 \u062A\u0648\u062C\u0647 \u0628\u0647 \u0634\u0631\u0627\u06CC\u0637 \u0645\u0648\u062C\u0648\u062F\u060C \u0634\u0645\u0627 \u062A\u0627 \u0647\u0641\u062A\u0647 \u0622\u06CC\u0646\u062F\u0647 \u062A\u0646\u0647\u0627 \u06CC\u06A9 \u0628\u0633\u062A\u0647 \u06CC \u06A9\u0645\u06A9\u06CC \u062F\u0631 \u0627\u062E\u062A\u06CC\u0627\u0631 \u062F\u0627\u0631\u06CC\u062F \u06A9\u0647 \u0634\u0627\u0645\u0644 \u062F\u0627\u0631\u0648 \u0627\u0632 \u062C\u0645\u0644\u0647 \u067E\u0646\u06CC \u0633\u06CC\u0644\u06CC\u0646\u060C \u063A\u0630\u0627\u06CC \u06A9\u0646\u0633\u0631\u0648 \u0634\u062F\u0647 \u060C \u0628\u0637\u0631\u06CC\u0647\u0627\u06CC \u0622\u0628 \u0622\u0634\u0627\u0645\u06CC\u062F\u0646\u06CC \u0648 \u0646\u06CC\u0632 \u0645\u0642\u062F\u0627\u0631\u06CC \u067E\u0648\u0644 \u0645\u06CC \u0628\u0627\u0634\u062F. \u0628\u0646\u0627\u0628\u0631\u0627\u06CC\u0646 \u0628\u0627\u06CC\u062F \u062F\u0631\u0645\u0648\u0631\u062F \u0627\u06CC\u0646\u06A9\u0647 \u0686\u0647 \u0686\u06CC\u0632 \u0628\u0647 \u062E\u0627\u0646\u0648\u0627\u062F\u0647 \u0634\u0645\u0627 \u0648 \u0686\u0647 \u0686\u06CC\u0632 \u0628\u0647 \u062E\u0627\u0646\u0648\u0627\u062F\u0647 \u062F\u06CC\u06AF\u0631 \u062A\u0639\u0644\u0642 \u0628\u06AF\u06CC\u0631\u062F \u0628\u0627 \u0622\u0646\u0647\u0627 \u0645\u0630\u0627\u06A9\u0631\u0647 \u06A9\u0646\u06CC\u062F. <\/p><p>.\u0627\u06CC\u0646 \u0645\u0630\u0627\u06A9\u0631\u0647 \u062F\u0631 \u0637\u06CC \u0686\u0646\u062F \u067E\u06CC\u0634\u0646\u0647\u0627\u062F \u0645\u062A\u0646\u0627\u0648\u0628 \u0627\u0646\u062C\u0627\u0645 \u0645\u06CC \u06AF\u06CC\u0631\u062F. \u0634\u0645\u0627 \u0627\u0648\u0644\u06CC\u0646 \u067E\u06CC\u0634\u0646\u0647\u0627\u062F \u0631\u0627 \u0645\u0637\u0631\u062D \u0645\u06CC \u06A9\u0646\u06CC\u062F. \u0637\u0631\u0641 \u0645\u0642\u0627\u0628\u0644 \u0634\u0645\u0627 \u0645\u0645\u06A9\u0646 \u0627\u0633\u062A \u067E\u06CC\u0634\u0646\u0647\u0627\u062F\u0627\u062A \u0634\u0645\u0627 \u0628\u067E\u0630\u06CC\u0631\u0646\u062F \u06CC\u0627 \u0622\u0646\u0647\u0627 \u0631\u0627 \u0631\u062F \u06A9\u0646\u062F. \u0627\u06AF\u0631 \u0622\u0646\u0647\u0627 \u0646\u067E\u0630\u06CC\u0631\u0646\u062F \u0648 \u067E\u06CC\u0634\u0646\u0647\u0627\u062F\u062A\u0627\u0646 \u0631\u0627 \u0631\u062F \u06A9\u0646\u0646\u062F\u060C \u067E\u06CC\u0634\u0646\u0647\u0627\u062F\u06CC \u062C\u062F\u06CC\u062F \u0627\u0632 \u0637\u0631\u0641 \u062E\u0648\u062F \u0645\u0637\u0631\u062D \u0645\u06CC \u06A9\u0646\u062F. \u0634\u0645\u0627 \u0646\u06CC\u0632 \u062F\u0631 \u0631\u062F \u06CC\u0627 \u067E\u0630\u06CC\u0631\u0634 \u0622\u0646 \u0645\u062E\u062A\u0627\u0631\u06CC\u062F. \u0627\u06AF\u0631 \u0622\u0646 \u0631\u0627 \u0628\u067E\u0630\u06CC\u0631\u06CC\u062F \u0627\u062C\u0646\u0627\u0633\u06CC \u06A9\u0647 \u06A9\u0647 \u0628\u0647 \u0637\u0631\u0641 \u062F\u06CC\u06AF\u0631 \u0646\u062F\u0627\u062F\u06CC\u062F \u0628\u0647 \u0634\u0645\u0627 \u062A\u0639\u0644\u0642 \u0645\u06CC\u06AF\u06CC\u0631\u062F. \u0627\u06AF\u0631 \u0627\u0632 \u067E\u06CC\u0634\u0646\u0647\u0627\u062F \u062E\u0627\u0646\u0648\u0627\u062F\u0647 \u0645\u0642\u0627\u0628\u0644 \u0631\u0627\u0636\u06CC \u0646\u0628\u0648\u
